import axios from "axios";
import auth_header from "./auth_header";

export const codeCompletion = async (data) => {
    return axios
        .post('http://localhost:3600/code/', data, { headers: await auth_header() })
        .then((response) => {
            return response.data;
        });
};

export const uploadCode = async (data) => {
    return axios
        .post('http://localhost:3600/coder/upload/', data, { headers: await auth_header() })
        .then((response) => {
            return response.data;
        });
};

export const uploadStudentCode = async (data) => {
    return axios
        .post('http://localhost:3600/student/upload/', data, { headers: await auth_header() })
        .then((response) => {
            return response.data;
        });
};

export const getCreatedUploads = async () => {
    return axios
        .get('http://localhost:3600/coder/upload/', { headers: await auth_header() })
        .then((response) => {
            return response.data;
        });
};

export const getSuitableUploads = async (searchOffset) => {
    return axios
        .post('http://localhost:3600/student/tasks/', searchOffset, { headers: await auth_header() })
        .then((response) => {
            return response.data;
        });
};

export const getAnalyticsUploads = async (reviewIds) => {
    return axios
        .post('http://localhost:3600/student/analytics/', reviewIds, { headers: await auth_header() })
        .then((response) => {
            return response.data;
        });
};

export const proposeCode = async (code) => {
    return axios
        .post('http://localhost:3600/student/proposal/', code, {headers: await auth_header()})
        .then((response) => {
            return response.data;
        });
}
